import React from "react";
import { Navbar } from "./Navbar";
import ImagesCarousel from "./ImagesCarousel";
import Footer from "./Footer";
import NewNav from "./NewNav";

function Accueil() {
  return (
    <div>
      <Navbar
        style={{
          position: "sticky",
          top: 0,
          backgroundColor: "rgba(255, 255, 255, 0.9)",
        }}
      />
      <NewNav />
      <ImagesCarousel />
      <ImagesCarousel />
      <ImagesCarousel />
      <Footer />
    </div>
  );
}

export default Accueil;
